import React from "react";
import {Link} from "react-router-dom";
import name from "./image/name.jpg";
import Card1 from "./Card1";
 import Card2 from "./Card2";
 import Card3 from "./Card3";
 import Card4 from "./Card4";
 import Card5 from "./Card5";

//import Flowers from ".src/images/Flowers.jpg";


const Header1=()=>{

        return(
            <>
          
        <div className="top_nav_new">
        <div className="list_new">
        <ul>
      <h1>
      <Link to="/" className="tilt_new">tilt</Link></h1>
      <li><Link to="/Home" className="click_new">Home</Link></li>
      <li><Link to="/Discover" className="click_new">Discover</Link></li>
      <li><Link to="/Campaign" className="click_new">Campaign</Link></li>
      <li><Link to="/Lists" className="click_new">Lists</Link></li>
      <li><Link to="/Reports" className="click_new">Reports</Link></li> 
      <li>
      <span className="icon-style">
      <i className="fa fa-bell-o" aria-hidden="true"></i>
      </span>
      </li>
      <li>
          <div className="border"></div>
      </li>
      <li>
      <span className="icon-style">
      <i className="fa fa-envelope-o" aria-hidden="true"></i>
      </span> 
      </li>
      <li>
          <div className="border"></div>
      </li>

      
       <li>
      {/* <input className="padding" type="text"/>    */}
      <img src={name} className="padding"/>
      </li>

      <li>
      {/* <input className="padding1" type="text"/>   */}
       <div className="dropdown">
  <button  type="button" id="dropdownMenuButton" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
    Dropdown button <i className="fa fa-sort-desc fa-2x" aria-hidden="true"></i>
  </button>
   {/* <div className="dropdown-menu" aria-labelledby="dropdownMenuButton"> */}
    {/* <a class="dropdown-item" href="#">profile</a>
    <a class="dropdown-item" href="#">setting</a> */}
      {/* </div>  */}
  </div>


      </li>
      </ul>
      </div>
        
    </div>

<Card1/>
<Card2/>
<Card3/>
<Card4/>
<Card5/> 
     
   </>
    )
}

export default Header1;
